import React from "react";

function Login(){
    return(
        <Box sx={{
            display: "grid",
            gap: "0",
            width:"100%",
            margin: "100px auto",
            gridTemplateAreas: `"imagePart loginPart"`,

            gridTemplateColumns: {md : "3fr 2fr" , xs: '0fr 1fr'}
           }}>
                <Box sx={{ gridArea: 'imagePart' , border:1 ,display:{md : 'block' , xs:'none'}}}>Story</Box>
                <Box sx={{ gridArea: 'loginPart', border:1, height:"500px"  ,mt: 10 ,maxHeight:"300px"}}> Box</Box>
        </Box>

    );
}

export default Login;
